import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import { makeStyles } from '@material-ui/core/styles';
import { purple } from '@material-ui/core/colors';


const useStyles = makeStyles({
  list: {
    width: 250,
  },
  title: {
    flexGrow: 1,
    color: purple[800]
  },
  menuButton: {
    marginLeft: -15,
  },
  twitter: {
    marginLeft: 10,
  }
});


export default function Header() {
  
  const classes = useStyles();

  return (
    <React.Fragment>
    <CssBaseline />
      <AppBar position="static" style={{ background: '#d1c4e9' }}>
        <Toolbar>
          <IconButton className={classes.menuButton} color="inherit" aria-label="Menu">
              <MenuIcon style={{ color: purple[800]}}/>
          </IconButton>
          <Typography variant="h6" className={classes.title} align="center" color="inherit">Shin-Nosuke Iino</Typography>
          <a href="https://github.com/Shinnosuke7031"><i class="fa fa-github fa-2x" aria-hidden="true"></i></a>
          <a href="https://github.com/Shinnosuke7031" className={classes.twitter}><i class="fa fa-twitter fa-2x" aria-hidden="true"></i></a>
        </Toolbar>
      </AppBar>
  </React.Fragment>
  );
}
